        "description": "<p>Fall is quickly coming upon us and the colors around us are awesome.  Let's learn alittle about water coloring with all our favorite fall colors. Then to make it extra special....... we will do the Bokeh!  (This is not a dance, but you can wig while you bokeh.)<\/p> <p>This is always a great technique. It is so much more than just making circles. We are going to play with watercolors, a resist technique and dry ink technique. Then we are going to make each of these techniques into a gorgeous card and add an interesting envelope to mail your card.<\/p> <p>Attention Moms: This is the sort of class you will want to bring your daughters too. They seem to come up with the most wonderful colors and designs. (Sometimes they make me jealous.) I have a supply charge only for them, of $10 with a paying adult.<\/p> <p>Supplies to bring: Trimmer, scissors, favorite adhesive. If you are worried about messing up your nails? Bring your own gloves. (But we are using watercolor.)<\/p> <p>Cost of the class:  $25 or a $25 Stampin Up order.<\/p> <p>If you would like to order in advance please use hostess code: <i><b>PR7AS6EN  <\/b>Our hostess of the month will be grateful. <\/i><\/p> <p><i> Would  you like to be  the Hostess of the Month?  Just ask for details. <\/i><\/p>",
