        "description": "<p><b>The Dances of Universal Peace<\/b> are simple, meditative, and joyous circle dances. They use sacred phrases, chants, movements, and music from the world's wisdom traditions. There are no performers, no audience members, and no experience is necessary!<\/p> <p>Come be inspired by the beauty and grace of the dances and the company of dancing friends.<\/p> <p><b>Potluck starts at 6 PM, Dance: 7:30 - 9:30 PM,<\/b> Potluck: 6-7 PM, Dance: 7:30-9:30 PM,  <b>$10 donation is requested<\/b>; no one turned away for any reason. Contact Nur Julie Purcell, [masked] for more information.<\/p> <p><b>Please RSVP so we know you will be joining us.<\/b> Looking forward to seeing you at the Durham Dance.<\/p> <p><b>We would appreciate your feedback<\/b> via the Meetup survey Emailed to you after the Dance event. Thanks!<\/p>",
