        "description": "<p>Join your fellow CHAD members for a gathering this Saturday night at Trali Irish Pub and Restaurant in Morrisville. September 17th is halfway to St. Patrick's Day, so it's a perfect night to celebrate your Irishness, even if you aren't the least bit Irish!<\/p> <p>Trali is one of the best and most authentic Irish pubs I've experienced in the USA, with Irish beer that tastes like you're really in the Emerald Isle and a nice variety of tasty food, including some traditional Irish dishes.<\/p> <p><a href=\"http:\/\/www.traliirishpub.com\/#about\" class=\"linkified\">http:\/\/www.traliirishpub.com\/#about<\/a><\/p> <p><a href=\"http:\/\/www.traliirishpub.com\/drinks-m\/\" class=\"linkified\">http:\/\/www.traliirishpub.com\/drinks-m\/<\/a><\/p> <p>The pub is easy to get to from Durham or Chapel Hill, about 12 miles (no more than 20 minutes) from the Hope Valley Farms area of Durham.<\/p> <p>If anybody is interested in carpooling from Durham (I live in Hope Valley Farms), post a comment here and we'll figure it out.<\/p> <p>See ye on Saturday night.  Slainte!<\/p> <p><img src=\"http:\/\/photos3.meetupstatic.com\/photos\/event\/8\/7\/6\/b\/600_454114667.jpeg\" \/><\/p>",
