        "description": "<p><b>Dress up for the disco and join us for a fun night of dancing and mingling with other singles in a smoke-free, alcohol-free setting. About 50-60 people attend the dance, and the attire is casual. The Triangle Singles Club requires that everyone attending the dance be single (divorced or separated, widowed or never married). All levels of dancing ability are welcome, and you don't have to bring a partner. Non-dancers are welcome, too! There is plenty of seating around the room where you can have conversations with new and old friends. The club is primarily for singles over  40, but people under 40 are welcome. <\/b><\/p> <p><b>This evening, J. R. Holloway will be our DJ. The admission at the door ($7 for dues-paying club members*, $10 for guests) includes:<\/b><\/p> <p><b>• a dance lesson from 8:00-8:30 pm (this week the lesson is Hustle),<br\/><\/b><\/p> <p><b>• dancing to a variety of music provided by our DJ (shag, swing, two-step, waltz, cha cha, freestyle, line and slow dances) from 8:30-11:00 pm, and<\/b><\/p> <p><br\/><b>• light refreshments with beverages.<\/b><\/p> <p><b>After the dance, the night owls may head out to a restaurant for more fun!<\/b><\/p> <p>*Please note that joining this Meetup group is free, but to qualify for the \"club member\" discount admission of $7 vs. the \"guest\" admission fee of $10, you have to purchase an optional $25 annual membership from the Triangle Singles Club at one of the dances.<\/p> <p>Directions to Northbrook Country Club: From Glenwood Avenue, turn onto Lead Mine Road (across from Crabtree Valley Mall and Blue Ridge Road), then make an immediate right at the first traffic light onto North Hills Drive. Go about a mile, and just past the first traffic light (still on North Hills Drive), look to your left and you will see two white brick pillars and a sign at the entrance to Northbrook Country Club.<\/p> <p><b>Weekly Dance Parties, Beach Trips, Dining-Out Evenings, and Special Holiday Parties…The Triangle Singles Club has it all! The Club provides fun social activities for singles over 40. For more information, see <a href=\"http:\/\/www.meetup.com\/Triangle-Singles-Club.\">www.meetup.com\/Triangle-Singles-Club.<\/a> This meetup is also posted on the Triangle Singles Club Meetup Group, <a href=\"http:\/\/www.meetup.com\/Triangle-Singles-Club.\">www.meetup.com\/Triangle-Singles-Club.<\/a><\/b><\/p>",
