        "description": "<p><img src=\"http:\/\/photos3.meetupstatic.com\/photos\/event\/7\/f\/d\/5\/600_448292725.jpeg\" \/><\/p> <p>Let's go back to C-Grace Cocktail Lounge to listen to Tin Tuxedo. Cocktail lounge with a Prohibition-era feel presenting live jazz &amp; classic handcrafted drinks.<\/p> <p><br\/>Let's meet before the music starts at 9pm. Cover charge of $5 after 8:30 PM. <i>Please note service at the bigger bar starts around 8:10 PM.<br\/><\/i><\/p> <p>Out of consideration for C-Grace's smaller space, firm RSVPs only, please.<\/p> <p><a href=\"http:\/\/www.cgracebar.com\/\"><a href=\"http:\/\/www.cgracebar.com\/\" class=\"linkified\">http:\/\/www.cgracebar.com\/<\/a><\/a><\/p> <p>If you arrive later and there is a wait at the door, the Empress Room directly above C-Grace may be a nice alternate spot.<\/p> <p><b>Parking<\/b>: Street and a lot behind and next to C-Grace.<\/p> <p>If you are new, happy to introduce you to others of our group - just come find me (Kat)<\/p>",
