        "description": "<p>Come along and join me for a quick pace evening intermediate hike Sunday morning before it gets hot!<\/p> <p>I'd like to start the hike by 8:01 AM so please be on time.  The parking lot gets busy on the weekends so give yourself a few extra moments to arrive and get to the meeting spot.  <\/p> <p><br\/>This is a fitness hike at a fast &amp; steady pace of 3+mph with few brief stops. Hike will be 6.25 miles and take about 2 hours.     <\/p> <p><br\/>DIFFICULTY: Moderate due to distance and terrain.  Umstead Park trails have roots, rocks, and rolling hills.  6.25 miles total distance covered with an option to extend to ~7 miles total depending on the group.<\/p> <p>WHAT TO BRING: Good hiking footwear, water and a great attitude.<br\/>LOCATION: Meet near the kiosk, back right corner of parking lot. <br\/>WEATHER:  If it's sprinkling lightly, I will still run the event.  If it's raining steady or the weather looks ominous I'll cancel this event at least an hour before the start time. <\/p> <p>I look forward to seeing you there.<\/p> <p>Mark<\/p> <p>By participating in this event, you agree to the terms below:<\/p> <p>TRIP PARTICIPANT WAIVER OF LIABILITY I fully realize that this activity involves a risk of personal injury, property damage, or loss of my person or property. I hereby for myself, my heirs, executors and administrators, and same for persons with whom are in my party, waive and release any claims or rights against Triangle Hiking &amp; Outdoors Group (THOG), all of its owners and coordinators for any and all injury, damages or loss to my person or property incurred during this activity. I also understand that THOG organizers are not required, nor should it be assumed that they are CPR\/First Aid\/Wilderness Survival Certified and I am responsible for my own personal safety.<\/p>",
